contracts/ETHTransfer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FundDeposit {
    address payable public owner;
    address payable public targetAddress;

    constructor(address payable _targetAddress) {
        owner = payable(msg.sender);
        targetAddress = _targetAddress;
    }
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    receive() external payable {
        DepostFunds();
    }

    function DepostFunds() public payable {
        require(msg.value > 0, "Invalid ETH amount");
        uint256 _ethamount = msg.value;
        (bool success, ) = targetAddress.call{value: _ethamount}("");
        require(success, "Transfer failed");
    }

    function changeAddress(
        address payable _newtragetaddress
    ) external onlyOwner {
        require(_newtragetaddress != address(0), "Invalid token address");
        targetAddress = _newtragetaddress;
    }
}

